CREATE TABLE mytable(
   uid                  VARCHAR(28) NOT NULL PRIMARY KEY
  ,gender               VARCHAR(17) NOT NULL
  ,status               VARCHAR(25) NOT NULL
  ,statusUpdatedAt      DATE  NOT NULL
  ,statusPrevious       VARCHAR(25) NOT NULL
  ,age                  VARCHAR(7) NOT NULL
  ,areaCode             INTEGER  NOT NULL
  ,state                VARCHAR(2) NOT NULL
  ,recurrence           VARCHAR(7) NOT NULL
  ,activation_date      DATE  NOT NULL
  ,end_portability_date DATE 
  ,current_package      VARCHAR(13) NOT NULL
);
